import java.util.*
import kotlin.collections.ArrayList

class SolutionInKotlin {
    companion object {
        @JvmStatic
        fun main(args: Array<String>) {
            println(substrCount(727310, ""))
        }

        fun isValid(s: String): String {
            var data = s.get(0) - 'a'
            // Write your code here
            var value = s.toCharArray()
            var comparelist = "abcdefghijklmnopqrstuvwxyz".toCharArray()
            var answerList = IntArray(value.size)
            for ((index, data) in value.withIndex()) {
                if (comparelist.contains(data)) {
                    answerList[index]++
                }
            }
            Arrays.sort(answerList)
            var first = answerList[0]
            var second = answerList[1]
            var secondLast = answerList[answerList.size - 2]
            var last = answerList[answerList.size - 1]

            if (first == last) {
                return "YES"
            }
            if (first == 1 && second == last) {
                return "YES"
            }
            if (first == second && second == secondLast && secondLast == (last - 1)) return "YES";

            return "NO"
        }

        // Complete the substrCount function below.
        fun substrCount(n: Int, s: String): Long {
            var charArray = s.toCharArray()
            var freq = IntArray(26)
            for ((index) in charArray.withIndex()) {
                freq[charArray.get(index) - 'a']++
            }
            var resultFreq = ArrayList<Int>(charArray.size)
            for ((index) in freq.withIndex()) {
                if (freq[index] != 0) {
                    resultFreq.add(freq[index])
                }
            }
            if (resultFreq.size == 1) {
                var temp = charArray.size * (charArray.size + 1)
                return (temp / 2).toLong()
            }
            var count = 0;
            for ((index) in charArray.withIndex()) {
                if (index != 0 && index != charArray.size - 1) {
                    var previous = charArray.get(index - 1)
                    var next = charArray.get(index + 1)

                    if (previous == next && previous != charArray.get(index)) {
                        count++;
                    }
                }

            }

            return (count + charArray.size).toLong()
        }
    }


}
